import React from "react";
import { GoogleMap } from "@react-google-maps/api";
export default function Map(){
    return (
        <div className="map">
            <GoogleMap 
                defaultCenter ={{lat : -34.397, lng : 150.644}}
                defaultZoom={8}            />
        </div>
    );
}
